import React from "react";

export interface NavbarProps {
    
}
 
const Navbar: React.SFC<NavbarProps> = () => {
    return ( 
        <div className="navbar">
            <h1>SHOPMATE</h1>
            <nav>
                <a href="">Women</a>
                <a href="">Men</a>
                <a href="">Kids</a>
                <a href="">Shoes</a>
                <a href="">Brands</a>
            </nav>
        </div>
     );
}
 
export default Navbar;
